import React from 'react';
import { Card, CardMedia, CardContent, CardActions, Button, Typography } from '@mui/material';

import resortLogo from '../../images/heavenly.png';


export default function Resort(props) {
   const [isBodyLoading, setIsBodyLoading] = React.useState(true);

   let resortData = {};
   const corsProxy = 'https://mighty-scrubland-75189.herokuapp.com';

   React.useEffect(() => {
      fetch(`${corsProxy}/https://liftie.info/api/resort/${props.resort.query}`)
         .then(response => response.json())
         .then(data => {
            resortData = { ...data };
            setIsBodyLoading(false);
            console.log(resortData);
         })
         .catch((error) => {
            console.log(`Encountered error in Liftie Fetch request: ${error}`)
         });
   }, [])


   return (
      <ul>
         {isBodyLoading ? <div>Loading... </div> :
            <li key={resortData.id}>
               <Card sx={{ maxWidth: 345 }}>
                  <CardMedia
                     component='img'
                     height='140'
                     image={resortLogo}
                     alt="ski resort logo"
                  />
                  <CardContent>
                     <Typography gutterBottom variant='h3' component='div'>
                        {resortData.name}
                     </Typography>
                     <Typography variant='body2' color='text.secondary'>
                        Put some text over here {resortData.href}
                     </Typography>
                  </CardContent>
               </Card>
            </li>}
      </ul>
   )
}
